import React, { useEffect, useState } from 'react';
import './DVLeadView.css';

function DVLeadView() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('/api/dv-data')
      .then(res => res.json())
      .then(json => setData(Array.isArray(json) ? json : []))
      .catch(() => setData([]));
  }, []);
  return (
    <div style={{ padding: 24 }}>
      <h2>DV Lead View</h2>
      <p>Detailed data for leads (customize as needed)</p>
      <table border={1} cellPadding={6} cellSpacing={0}>
        <thead>
          <tr>
            <th>Module</th>
            <th>TB Dev Coded</th>
            <th>Test Coded</th>
            <th>Test Fail</th>
            <th>Functional Coverage (%)</th>
            <th>Block Status</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, idx) => (
            <tr key={row.id || idx}>
              <td>{row.module}</td>
              <td>{row.tb_dev_coded}</td>
              <td>{row.test_coded}</td>
              <td>{row.test_fail}</td>
              <td>{row.functional_coverage_percent}</td>
              <td>{row.block_status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
export default DVLeadView;
